var run = function(){
	_____piect.forEach(function(point) {
		if(point[3] == '10m'){
			self.PATH_10m.push([point[0], point[1]]);
		}
		else if(point[3] == '100m'){
			self.PATH_100m.push([point[0], point[1]]);
		}
		else if(point[3] == '50mb'){
			self.PATH_50mb.push([point[0], point[1]]);
		}
		else if(point[3] == '100mb'){
			self.PATH_100mb.push([point[0], point[1]]);
		}
		else if(point[3] == '200mb'){
			self.PATH_200mb.push([point[0], point[1]]);
		}
		else if(point[3] == '250mb'){
			self.PATH_250mb.push([point[0], point[1]]);
		}
	});
};
var draw = function(){
	L.polyline(self.PATH_10m , {color: pColor[0]}).addTo(self.map);
	L.polyline(self.PATH_100m , {color: pColor[1]}).addTo(self.map);
	L.polyline(self.PATH_50mb , {color: pColor[2]}).addTo(self.map);
	L.polyline(self.PATH_100mb, {color: pColor[3]}).addTo(self.map);
	L.polyline(self.PATH_200mb, {color: pColor[4]}).addTo(self.map);
	L.polyline(self.PATH_250mb, {color: pColor[5]}).addTo(self.map);
}

